"use strict";
function selectionSortAlgorithm(arr) {
    for (let i = 0; i < arr.length; i++) {
        for (let j = i + 1; j < arr.length; j++) {
            if (arr[i] > arr[j]) {
                let minor = arr[i];
                arr[i] = arr[j];
                arr[j] = minor;
            }
        }
    }
    return arr;
}
